import React from "react";




class SearchBar extends React.Component{

    state= {
        term: ''
    }

     render(){
         return (
         <div className="ui segment">
             <form className="ui form">
                    <div className="field">
                        <label>Videos Search</label>
                        <input type="text">{this.state.term}</input>
                    </div>
             </form>
         </div>
         )
     }


}
export default SearchBar;
